import React from 'react'
import ReactDOM, { render } from 'react-dom'

function App(){
  return(
    <h1>Test 1</h1>
  );
}
ReactDOM.render(
  <div>
    <p>Here is test</p>
    <ul>
      <li>Facebook</li>
      <li>Youtube</li>
      <li>Instagram</li>
    </ul>
  </div>,
  document.getElementById('root'));
